import React from "react";

const View = () => {
  return (
    <>
      <div className="mt-5 border">
        <table className="table">
          <thead>
            <th> S. No </th>
            <th> Profile </th>
            <th> Name </th>
            <th> Disc </th>
            <th> Created Date </th>
            <th> Updated Date </th>
            <th> Status </th>
          </thead>
        </table>
      </div>
    </>
  );
};

export default View;
